import React from 'react'
import ItemsJson from './television.json'

export const Items =()=>{

    console.log(ItemsJson)

    const itemsJson=ItemsJson

    return(
        <>
        {itemsJson.map(item=>{
                return(
                    <p>{item.name}</p>
                )
        })}
        </>
    )
}
